import React from 'react'

function NavbarMain() {
  return (
    <div className='containernav'>
        <h2>Car App</h2>
        <Link to='/'><Button></Button></Link>
        <Link to='/forums'><Button>Forum</Button></Link>
    </div>
  )
}

export default NavbarMain
